import React from "react";
import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { useParams } from 'react-router-dom';
import { DetailDog } from '../Redux/Actions/Action';
import './Detail.css';

function Detail(){
    const dispatch = useDispatch();
    const { id } = useParams();
    const detailDogData = useSelector((state) => state.detailDog);
    console.log('detalle del perro en el componente ->', detailDogData);

    useEffect(() => {
        dispatch(DetailDog(id));
    }, [dispatch]);

    return (
        <div className="cardContainerDetail">
            {
                detailDogData?.map((el) => {
                    return (
                        <div class="cardDetail">
                            <div class="card-img">
                                <img src={el.image} />
                            </div>
                            <div class="card-info">
                                <p class="text-title"> {el.name} </p>
                                <p class="text-body"> {el.temperament} </p>
                            </div>
                        </div>
                    )
                })
            }
        </div>
    )
}

export default Detail;
